import React from 'react';
import { View, Text, TouchableOpacity } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import styles from '../styles/styles';

function ProfileScreen() {
  const user = {
    name: 'Иван Иванов',
    email: 'ivan@example.com',
    position: 'Менеджер',
  };

  const navigation = useNavigation();

  const handleHeaderItemClick = (screenName) => {
    navigation.navigate(screenName);
  };

  return (
    <View style={styles.container}>
      <View style={styles.contentContainer}>
      <Text style={styles.headlineLarge}>Профиль</Text>

      <View style={styles.header}>
        <TouchableOpacity
          style={styles.headerItem}
          onPress={() => handleHeaderItemClick('Данные клиента')}
        >
          <Text style={styles.headerItemText}>Данные клиента</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.headerItem}
          onPress={() => handleHeaderItemClick('Клиентская база')}
        >
          <Text style={styles.headerItemText}>Клиентская база</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.headerItem}
          onPress={() => handleHeaderItemClick('Финансы')}
        >
          <Text style={styles.headerItemText}>Финансы</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.headerItem}
          onPress={() => handleHeaderItemClick('Складской учёт')}
        >
          <Text style={styles.headerItemText}>Складской учёт</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.headerItem}
          onPress={() => handleHeaderItemClick('Уведомления')}
        >
          <Text style={styles.headerItemText}>Уведомления</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.headerItem}
          onPress={() => handleHeaderItemClick('Сотрудники')}
        >
          <Text style={styles.headerItemText}>Сотрудники</Text>
        </TouchableOpacity>
      </View>
      </View>
      </View>
  );
}

export default ProfileScreen;
